class Solution:
    def maxOperations(self, s: str) -> int:
        ret = 0
        k = 0
        move = False

        for ch in s:
            if ch == '1':
                if move:
                    move = False
                    ret += k
                k += 1
            else:
                move = True

        if move:
            ret += k

        return ret
